import React from "react";

const ProductImage = () => {
  return (
    <div className="product-image">
      <img
        src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT7lhWth5I8OuPTUymSiTYWJ6hhaTY1_6vbWai7CzJiV3k0jCPh&s"
        alt="Image"
      />
    </div>
  );
};

export default ProductImage;
